import React from "react";

import BigContainer from "./BigContainer";
import SmallContainer from "./SmallContainer";

const Dashboard = () => {
    return (
        <div className="dashboard">
          <div className="row">
            <BigContainer title="Schedule" />
            <SmallContainer title="Upcoming Events" />
          </div>
          <div className="row">
            <BigContainer title="Roster" />
            <SmallContainer title="Message Team" />
          </div>
        </div>
    );
}

export default Dashboard;
